current_collision_map = collision_maps['level_0']
goto_level('level_0')

grid_size = len(current_collision_map)

def update():
    # normalized * grid_size
    grid_x = int((player.x + (mg.scale_x/2)) / mg.scale_x * grid_size)
    grid_y = int((player.y + (mg.scale_y/2)) / mg.scale_y * grid_size)
    # print(grid_x, grid_y, current_collision_map[grid_x][grid_y])
    if not current_collision_map[grid_size-grid_y][grid_x]:
        # player.graphics.color = color.red
        player.y += fall_speed
    else:
        # player.graphics.color = color.white
        player.y -= fall_speed

    if held_keys['shift']:
        player.x += (held_keys['d'] - held_keys['a']) * speed
        player.y += (held_keys['w'] - held_keys['s']) * speed * 5

    if held_keys['d'] and current_collision_map[grid_size-grid_y-3][grid_x+1]:
        player.x += speed
        if player.graphics.texture != 'red_planet_player.png':
            # print(player.graphics.texture)
            player.graphics.texture = 'red_planet_player.png'
    if held_keys['a'] and current_collision_map[grid_size-grid_y-3][grid_x-1]:
        player.x -= speed
        if player.graphics.texture != 'red_planet_player_flipped.png':
            # print(player.graphics.texture)
            player.graphics.texture = 'red_planet_player_flipped.png'
    player.y += (held_keys['w'] - held_keys['s']) * speed

    if not mouse.hovered_entity:
        if mouse.x > .5:
            player.x += mouse.left * speed
        if mouse.x < -.5:
            player.x -= mouse.left * speed
    player.graphics.x = lerp(player.graphics.x, player.x, lerp_speed)
    player.graphics.y = lerp(player.graphics.y, player.y+.05, lerp_speed/4)
    # camera.x = player.x
    # camera.y = player.y
    camera.x = lerp(camera.x, player.x, .025)
    camera.x = clamp(camera.x, -mg.scale_x/2+(camera.fov/2*aspect_ratio), mg.scale_x/2-(camera.fov/2*aspect_ratio))
    # camera.x = clamp(camera.x, camera.fov/2, mg.scale_x-(camera.fov/2))
    camera.y = lerp(camera.y, player.y+.2, .025)
    camera.y = clamp(camera.y, -mg.scale_y/2+(camera.fov/2), mg.scale_y/2-(camera.fov/2))
    # camera.y = max(camera.y, -1000)
    # camera.x += (held_keys['d'] - held_keys['a']) * .01
    fg.x = camera.x * -.3
    fg.y = camera.y * -.3
    bg.x = camera.x * .03
    bg.y = camera.y * .03
    bbg.x = camera.x * .5
    bbg.y = camera.y * .5
    sky.x = camera.x * 1
    sky.y = camera.y * 1

    # change level
    if player.x > 2 - .05 or held_keys['e']:
        if current_level_name == 'level_0':
            player.x = -2 + .1
            goto_level('level_1')
    if player.x < -2 + .05 or held_keys['q']:
        if current_level_name == 'level_1':
            player.x = 2 - .1
            goto_level('level_0')


points = []
for pos in [[-1.55,-1.65], [-1.1,-1.25], [-.6,-1.2]]:
    p = Entity(scale=.2, xy=pos, roundness=.5, texture='ring_dashed.png', alpha=.5, on_click=True)
    points.append(p)

# player.xy = points[0].xy
# player.graphics.xy = player.xy


gun_line = Entity(scale=.005, enabled=False, color=color.white, origin=[-.5,0])
enemies = []
for pos in [[-.0,-1.1], ]:
    enemies.append(Entity(hp=3, scale=.2, xy=pos, roundness=.2, shadow=1, text='enemy', color=color.red, alpha=.3, on_click=True))

# print('----', enemies)

def input(key):
    # print('efijeofisejfoisef', enemies)
    if key == 'left mouse down' and mouse.hovered_entity:
        target = mouse.hovered_entity;
        is_enemy = target in enemies
        if is_enemy:
            target.hp -= 1
            gun_line.position = player.graphics.position
            gun_line.z = 1
            gun_line.enabled = True
            gun_line.scale_x = distance(player.graphics.position, target.position)
            gun_line.look_at(target.position)
            def disable():
                gun_line.enabled = False
            invoke(disable, delay=1/60)

            if target.hp <= 0:
                destroy(target)

            return

        player.xy = target.xy

app.run()
